      this._name = name;
      this._data = data;
      this._type = type;
    }

    get id() {
      return this._id || "";
    }
    get name() {
      return this._name || "";
    }
    get data() {
      return this._data || {};
    }
    get type() {
      return this._type || "";
    }

    set id(id) {
      this._id = id;
    }

    set name(name) {
